CREATE TABLE `registroatraso` (
  `cd_Registro` int(11) NOT NULL,
  `cd_Aluno` int(11) DEFAULT NULL,
  `nm_Aluno` varchar(100) DEFAULT NULL,
  `nm_Serie` varchar(100) DEFAULT NULL,
  `nm_Curso` varchar(100) DEFAULT NULL,
  `horario_entrada` time DEFAULT NULL,
  `data_registro` date DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

--
-- Acionadores `registroatraso`
--
DELIMITER $$
CREATE TRIGGER `trig_AVISO_3_atrasos` AFTER INSERT ON `registroatraso` FOR EACH ROW BEGIN
    DECLARE qtd_atrasos INT;
    DECLARE detalhes_atrasos TEXT;

    SELECT COUNT(*) INTO qtd_atrasos
    FROM RegistroAtraso
    WHERE cd_Aluno = NEW.cd_Aluno
		AND YEAR(data_registro) = YEAR(CURDATE()) 
		AND MONTH(data_registro) = MONTH(CURDATE()); 


    IF qtd_atrasos = 3 THEN
        SELECT GROUP_CONCAT(
            DATE_FORMAT(data_registro, '%d/%m/%Y') SEPARATOR ', '
        ) INTO detalhes_atrasos
        FROM (
            SELECT data_registro
            FROM RegistroAtraso
            WHERE cd_Aluno = NEW.cd_Aluno
				AND YEAR(data_registro) = YEAR(CURDATE())
                AND MONTH(data_registro) = MONTH(CURDATE())
            ORDER BY data_registro DESC
            LIMIT 3
        ) AS UltimosAtrasos;

        INSERT INTO Notificacao (cd_Aluno, mensagem)
        VALUES (
            NEW.cd_Aluno,
            CONCAT(
                'O aluno atingiu 3 atrasos no mês atual. Próximo atraso resultará em advertência. ',
                'Os dias dos atrasos foram: ', detalhes_atrasos, '.'
            )
        );
    END IF;
END
$$
DELIMITER ;

